Here's the recursive solution to the Fibonacci sequence problem:

```python
def fib(n: int) -> int:
    """
    Return n-th Fibonacci number.

    >>> fib(10)
    55
    >>> fib(1)
    1
    >>> fib(8)
    21
    """
    if n == 1 or n == 2:
        return 1
    else:
        return fib(n-1) + fib(n-2)
```

This function uses recursion to calculate the Fibonacci number at the n-th position. The base cases are when `n` is 1 or 2, in which case the function returns 1. For other values of `n`, the function calls itself with `n-1` and `n-2`, and returns their sum.

Please note that this implementation has an exponential time complexity (O(2^n)) because the same subproblems are solved multiple times. For larger values of `n`, this function may not perform efficiently. An iterative approach or memoization would be more efficient alternatives for this problem.

